import React from 'react';

var moment = require('moment');
var date = moment().format('MMMM Do YYYY, h:mm:ss a');
const css = {
    date:{
        color: black,
    }
}
export default ({styles}) =>{
    return(
        <header className="App-header" style={styles.header}>
                <h1>header</h1>
                <p css={css.date}> Currente date : {date}</p>           

        </header>
    );
}
